INSERT INTO `Units` (`id`, `landLordId`, `rent`, `title`, `bedrooms`, `baths`, `avgSqFt`, `availability`, `address`, `city`, `state`, `zip`, `phone`, `desc`, `type`, `createdAt`, `updatedAt`) VALUES (1,1,900.00,'Nice Apartment','1','1',670,'Available Now','160 S Virgil Ave','Los Angeles','CA','90004','310 505-1891','Luxury Spaces','Apartment','0000-00-00 00:00:00','0000-00-00 00:00:00');
INSERT INTO `Units` (`id`, `landLordId`, `rent`, `title`, `bedrooms`, `baths`, `avgSqFt`, `availability`, `address`, `city`, `state`, `zip`, `phone`, `desc`, `type`, `createdAt`, `updatedAt`) VALUES (3,2,1100.00,'Great Apartment','Studio','1',408,'Available Now','123 S Figueroa St.','Los Angeles','CA','90012','855 540-8832','Promenade Towers is a true departure from the ordinary. Our high rise towers surround a sparkling pool and tranquil fountain in an oasis of lush and pristine landscape, right in the middle of the hustle and bustle of Downtown Los Angeles. Unique and spacious apartments boast floor-to-ceiling windows, contemporary solariums and angular rooms with breathtaking views of the Los Angeles Downtown skyline or mountains. Our community offers residents a variety of amenities, including a fitness center, a 24-hour attended lobby, an on-site convenience store, a beauty salon and an on-site parking garage. The best entertainment venues in Downtown Los Angeles, including L.A. Live, Staples Center and Nokia Theater, as well as upscale museums, fine dining, great shopping and exciting night spots are just a few minutes away. Discover an urban oasis in the heart of Downtown Los Angeles at Promenade Towers.','Apartment','0000-00-00 00:00:00','0000-00-00 00:00:00');
INSERT INTO `Units` (`id`, `landLordId`, `rent`, `title`, `bedrooms`, `baths`, `avgSqFt`, `availability`, `address`, `city`, `state`, `zip`, `phone`, `desc`, `type`, `createdAt`, `updatedAt`) VALUES (4,3,1200.00,'Cozy Apartment','1','1',870,'Available Now','616 Kenmore Ave','Los Angeles','CA','90005','213 334-3717','','Apartment','0000-00-00 00:00:00','0000-00-00 00:00:00');
INSERT INTO `Units` (`id`, `landLordId`, `rent`, `title`, `bedrooms`, `baths`, `avgSqFt`, `availability`, `address`, `city`, `state`, `zip`, `phone`, `desc`, `type`, `createdAt`, `updatedAt`) VALUES (5,4,1500.00,'Modern Apartment','2','2',1073,'Available Now','5901 Center Dr','Los Angeles','CA','90045','214 206 9498','Discover picture-perfect living at Modera West LA, naturally sophisticated apartments primely positioned by the 405, Marina Expressway, and Interstate 10. These vivid apartments offer residents unparalleled access and ease, minutes from industry-leading tech firms, the citys sun-soaked beaches, and entertainment at The Promenade. Find treasured terrain in residences that have it all. Elegant studio, one-, two-, and three-bedroom apartments stand apart, boasting loft layouts, stylish ecomodern design, and state-of-the-art details. Standout interiors feature quartz countertops, upgraded stainless steel appliances and cabinet finishes, wood plank flooring throughout apartments, and select platinum-level finish packages. Set the scene in an effortlessly chic, ultra-amenitized destination  replete with virtual fitness classes, a media and gaming room, dedicated work-from-home hubs, and a two-story indoor-outdoor clubhouse. Embellished by an alfresco movie theater, best-in-class rooftop resort, and luxe pool and spa, Modera West LA offers a truly masterful mix of perks. Live in a destination location that paints a vibrant backdrop for your lifestyle. Move in, and get the ultimate perspective at Modera West LA.','Apartment','0000-00-00 00:00:00','0000-00-00 00:00:00');
INSERT INTO `Units` (`id`, `landLordId`, `rent`, `title`, `bedrooms`, `baths`, `avgSqFt`, `availability`, `address`, `city`, `state`, `zip`, `phone`, `desc`, `type`, `createdAt`, `updatedAt`) VALUES (6,5,1200.00,'Cozy Apartment','3','2',2925,'Available Now','6245 wilshire blvd','Los Angeles','CA','90048','844-232-6118','Embrace an unrivaled views and exquisite design at Vision on Wilshire. These luxury LA apartments feature gourmet kitchens complete with quartz countertops, premium Bosch appliances, and premium cabinetry with soft close doors. Enjoy spacious master suites, lavish bathrooms with Hansgrobe fixtures, designer accessories, hardwood flooring, and remote controlled window shades. Residents are invited to enjoy the convenient on-site amenities including the rooftop pool, fitness center, and work from home spaces. Enjoy premier shopping, chic eateries, and entertainment venues just steps from your door at The Grove. Schedule a tour today and experience luxury apartment living at VISION.','Apartment','0000-00-00 00:00:00','0000-00-00 00:00:00');
